import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import jobInfo from './ExperienceArray';

function Experience() {
  return (
    <section className="experience" style={{ paddingTop: '3rem' }}>
      <Container>
        <Row className="justify-content-center">
          <Col lg={10}>
            <h2>Experience</h2>
          </Col>
        </Row>
        <Row>
          <Col lg={4}>
            {jobInfo.map((job, index) => (
              <div className="job-info">
                <p key={index} className="job-title">{job.title}</p>
                <p key={index} className="job-dates">{job.start}&nbsp;-&nbsp;{job.end}</p>
              </div>
            ))}
          </Col>
          <Col lg={8}>
            {jobInfo.map((job, index) => (
              <div className="job-info">
                <p key={index} className="job-company">{job.company}</p>
                <p key={index} className="job-location"><i className="fa fa-map-marker"></i>{job.location}</p>
                <p key={index} className="job-description">{job.description}</p>
              </div>
            ))}
          </Col>
        </Row>
      </Container>
    </section>
  );
}

export default Experience;
